export default class Home extends Component {


    render() {

        if(this.props.email){
            return (
                <p>สวัสดี ยินดีต้อนรับ {this.props.user.email} </p>
            )
        }

        return (
                <p>กรุณาเข้าสู่ระบบเพื่อจองที่พัก</p>        
        )
    }
}
